const RouterPages = () => {
  return (
    <>
        <Routes>
            <Route path="/" element={<HomeScreens/>}/>
            <Route path="/Private" element={<RequireAuth><Private/></RequireAuth>}/>
        </Routes>
    </>
  )
}

export default RouterPages
